import React from "react";

const Character = () => {
  return (
    <div className="text-center">
      <img src=" ./img/leo.png" alt="" />
      <div className="d-flex mx-auto justify-content-center">
        <h2
          className="display-2  fw-bold text-light"
          style={{ position: "relative", marginTop: "-80px" }}
        >
          LEONARD <br />
          <span className="">STURART</span>
        </h2>
        <p className="display-4 text-start text-light">
          WINNER OF <br /> 4 CONSECUTIVE RACES
        </p>
      </div>

      <div>
        <button className="px-5 fw-bold">
          {" "}
          LEARN MORE ABOUT HIS EXPERIENCE
        </button>
      </div>
    </div>
  );
};

export default Character;
